*.MA[*].pingApp[*].destAddr = "CN1[*]"
*.MA[*].pingApp[*].startTime = 20s
*.MA[*].pingApp[*].stopTime = 430s
*.MA[*].pingApp[*].packetSize = 64B
*.MA[*].pingApp[*].sendInterval = 1s	
